import { Link } from 'react-router-dom'
import styled from 'styled-components'
import Navbar from './Navbar'
import Header from './Header'

const Div = styled.div`
    display: grid;
    grid-template-rows: 5em 5em 1em 1em;
    grid-gap: 0.5em;
`;

const Manage = () => {
    return (
        <Div>
            <Header />
            <Navbar />
        </Div>
    )
}

export default Manage
